webpackJsonp([0x9fba952ca243],{5351:function(t,e){t.exports={data:{post:{html:"<p>We were offline for a day and a half due to a ISDN outage. Did anyone miss us?</p>\n<p>More annoying than the Internet outage was the phone outage, since Mama and Christopher were away helping Oma Ruth move, and we needed to keep in touch to I could help unload the truck on this end. </p>\n<p>It was not particularly comforting this morning when reporting the outage to Deutsche Telekom to be connected to a call center in Bavaria. Gru√ü Gott! Ack, just last week I submitted the application to switch away from the big pink T to an alternative local telecom provider. The main reason being that T-Online no longer offers an ISDN flatrate, and cannot provide us with DSL.</p>",fields:{title:"Out Of Touch",date:"29 Sep 2001",url:"https://papascott.de/2001-09-29-out-of-touch/"}}},pathContext:{slug:"/2001-09-29-out-of-touch/",prev:{fields:{title:"Can't Stop",date:"28 Sep 2001",slug:"/2001-09-28-cant-stop/"}},next:{fields:{title:"Fast Asleep",date:"01 Oct 2001",slug:"/2001-10-01-fast-asleep/"}}}}}});
